%spark

// Arguably, we might be cross-contaminating our training and testing pools if we simply sample encounters, since some of our data
// involves patient histories. (Indeed, on the real data, sampling encounters artificially boosted AUC by a small but noticeable amount.)
// The sampleby string allows us to sample by patient instead of by encounter, eliminating this possibility.

def runPipelineOnData(fulldata: DataFrame, pipeline: Pipeline, PMMLClassNamePrefix: String, sampleby: String = "") : PipelineModel = {

    val splits = sampleby=="" match {
        case true => fulldata.randomSplit(Array(0.7, 0.3), 0)
        case false => fulldata.select(sampleby).distinct().randomSplit(Array(0.7, 0.3), 0)
    }
    val trainingData = sampleby=="" match {
        case true => splits(0)
        case false => fulldata.join(splits(0),usingColumn=sampleby).drop(sampleby)
    }
    val testingData = sampleby=="" match {
        case true => splits(1)
        case false => fulldata.join(splits(1),usingColumn=sampleby).drop(sampleby)
    }

    val pipelineModel = pipeline.fit(trainingData)
    val evaluator = new BinaryClassificationEvaluator().setLabelCol("MxWillReAdmit")

    val trainpred = pipelineModel.transform(trainingData)

    val train_auc = evaluator.evaluate(trainpred)

    val predictions = pipelineModel.transform(testingData)
    predictions.printSchema()

    val test_auc = evaluator.evaluate(predictions)

    println("\t\tTrain AUC = " + (train_auc))
    println("\t\tTest AUC = " + (test_auc))

    val fileName="/common_shared/pmml/IRISDemo.ImportedModel."+PMMLClassNamePrefix+".pmml"

    println("\t\tExporting the model to PMML file " + fileName)

    val file = new File(fileName)

    val pmmlBuilder = new org.jpmml.sparkml.PMMLBuilder(fulldata.schema, pipelineModel).buildFile(file)

    return pipelineModel

}

