// The MaxBins parameter needs to be at least as large as the number of possible categories for any categorical variable. So, we set it to the same value as the VectorIndexer's MaxCategories parameter, which we'd set earlier. MexDepth should be large enough to actually capture behavior, but not so large that it overfits the data. It's a tricky problem, but if you play with the parameters enough you can often get decent results.
